Well it's not entirely your fault... If you look closely into the library you may notice that the coordinates for the "F" and "G" points, which define the inner wall, are set to "d-4*k/2 * ..some_function.." which basically means that it subtracts 4 times the thread_pitch from the diameter. In your case (12-4*4).. results in a negative value.<br />
I've tried to set the x,y coordinates of these points to '0' so that the nasty hole in the middle would be closed all together, sadly this too results in errors...<br />
You can however set the width of the hole to a fixed size, change the lines for these two points by deleting the proportional factor "d-4k/2". Those lines should then read:<br />
/* F */  for(i=[0:n]) [cosinus(n,i),sinus(n,i),height(k,n,i,-0.5)],<br />
/* G */  for(i=[n*(m-1):n*m]) [cosinus(n,i),sinus(n,i),height(k,n,i,+0.5)],<br />
The hole in the center should now always have the same diameter of 2mm (to avoid issues the cylinder in the "union" should be bigger than 2)
